column8:
ウォーターポンプの機能<br>
<br>
ウォーターポンプは、エンジンを冷やすクーラント（冷却水）を循環させる役割を担う大切な部品です。<br>
エンジンの熱で高温になったクーラントはラジエーターで冷却され、再びエンジンへ戻されます。ウォーターポンプはラジエーターとエンジンの間に配置されており、プーリーを介してタイミングベルトやファンベルトにより駆動されることでクーラントを強制的に循環させる働きをしています。<br>
<br>
<br>
ウォーターポンプの構造<br>
<br>
<br>
ウォーターポンプは、主にボディ（アルミダイカスト・鋳物・グラビティ等）、フランジ（鍛造・焼結等）、インペラー（プレス・鋳物・樹脂）、ウォーターポンプベアリング、メカニカルシールから構成されており、性能や品質を考慮した上でお客様のご要望及び使用環境に応じて材質を使い分けています。<br>
<br>
クランクシャフトの回転から得た動力はプーリー、ウォーターポンプベアリングを介してインペラーを回転させます。<br>
このインペラーの回転により、遠心力でクーラントを外周に押し出し、循環させています。<br>
<br>
クーラントで満たされたポンプ室とウォーターポンプベアリングとは、メカニカルシールによって隔離されています。<br>
<br>
メカニカルシールのように動的回転シールの場合、常に潤滑して回転する必要があり、進入（＝潤滑）した液体は、蒸気となり、ボディの水抜孔より外部に排出される仕組みになっています。<style type="text/css">
